script: |
  super -f text -I q4596.spq | sort > q4596.out

inputs:
  - name: q4596.spq
    data: |
      SELECT + col0 + 87 AS col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT - 0 * + 3 * + col1 NOT BETWEEN - + col0 AND - col1 / + 75;
  - name: tab2

outputs:
  - name: q4596.out
    data: |
      133
      162
